import "./style.css";

const Navbar = () => {
    return (
        <nav>
            <ul className="nav-list">
                <li className="nav-list--item">О компании</li>
                <li className="nav-list--item">Новости</li>
                <li className="nav-list--item">Информация</li>
                <li className="nav-list--item">Контакты</li>
            </ul>
        </nav>
    );
  }
  
  export default Navbar;
